import React ,{ Component } from "react";

class PharmacoTool extends Component{
    render(){
        return(
            <div className={this.props.status?'hide':'pharma'}>
                <h1>PharmacoTool</h1>
            </div>
        )
    }
}
export default PharmacoTool;
